namespace BookRadarApi.MailSettings
{
    public class EmailModel 
    {        
        public string WelcomeHtmlEmail { get; set; } = string.Empty;
        public string WelcomePlainEmail { get; set; } = string.Empty;
        private string _path { get; set; }
        private string _userName { get; set; }
        private string _token { get; set; }
        private string? _image {  get; set; }

        public EmailModel()
        {
            _path = string.Empty;
            _userName = string.Empty;
            _token = string.Empty;
        }

        public void GenerateWelcomeEmail(string path, string userName, string token)
        {
            _path = path;
            _userName = userName;
            _token = token;
            //GetImage();
            GeneratePlain();
            GenerateHtml();
        }
        public void GeneratePlain()
        {
            WelcomePlainEmail = $@"Hello {_userName}!!
                            Thanks for signing up to Book Radar, we hope you get all of the books you are looking for.
                            Please follow the link copy and paste the below url in your browser to confirm your email address.</p>
                            
                            ""{_path + "?token=" + _token}""

                            If you have any questions, please reach out.

                            Happy Reading.

                            Book Radar Team";
        }
        public void GenerateHtml()
        {
            WelcomeHtmlEmail = $@"<!DOCTYPE html>
                            <html lang=""en"">
                            <head>
                                <meta charset=""UTF-8"">
                                <meta name=""viewport"" content=""width=device-width, initial-scale=1.0"">
                                <link rel=""preconnect"" href=""https://fonts.googleapis.com"">
                            <link rel=""preconnect"" href=""https://fonts.gstatic.com"" crossorigin>
                            <link href=""https://fonts.googleapis.com/css2?family=Roboto:ital,wght@1,300&display=swap"" rel=""stylesheet"">
                            <style>
                                body {{ font-family: 'Roboto', sans-serif; }}
                                .icon {{margin-left: 5px; vertical-align: middle;}}
                            </style>
                            <title>Welcome to Book Radar!</title>
                            </head>
                            <body>
                            <h3>Hello {_userName}!!</h3>
                            <p>Thanks for signing up to <b>Book Radar</b>, we hope you get all of the books you are looking for.</p><br/>
                            <p>Please click <a href=""{_path + "?token=" + _token}"">here</a> to confirm your email address.</p>
                            <p>If you have any questions, please reach out.</p>
                            <p>Happy Reading.</p>
                            <p><b>Book Radar Team</b></p>
                            <svg class=""icon"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 448 512"" width=""24"" height=""24""><path d=""M96 0C43 0 0 43 0 96V416c0 53 43 96 96 96H384h32c17.7 0 32-14.3 32-32s-14.3-32-32-32V384c17.7 0 32-14.3 32-32V32c0-17.7-14.3-32-32-32H384 96zm0 384H352v64H96c-17.7 0-32-14.3-32-32s14.3-32 32-32zm32-240c0-8.8 7.2-16 16-16H336c8.8 0 16 7.2 16 16s-7.2 16-16 16H144c-8.8 0-16-7.2-16-16zm16 48H336c8.8 0 16 7.2 16 16s-7.2 16-16 16H144c-8.8 0-16-7.2-16-16s7.2-16 16-16z""/></svg>
                            </body>
                            </html>";
        }
        public void GetImage()
        {
            _image = "";
        }
    }
}
